const IS_DARK_MODE = "Dark Mode" === "Dark Mode" ? true : false;
const DARK_MODE_STR = IS_DARK_MODE ? "dark_mode" : "light_mode";

// ========================================================================
// :: HELPER FUNCTIONS
// ========================================================================
const getDescendantProp = (obj, path) => {
    if (!path) return obj;
    return path.split('.').reduce((acc, part) => acc && acc[part], obj);
};

const convertOutputPathToMenuPath = (outputPath, menuDict) => {
    if (!outputPath) return outputPath;
    
    const parts = outputPath.split('.');
    const menuParts = [];
    
    for (let i = 0; i < parts.length; i++) {
        menuParts.push(parts[i]);
        
        // Check if this part exists in menuDict and is a Submenu or Enum
        const currentPath = menuParts.join('.');
        const item = getDescendantProp(menuDict, currentPath);

        if (item && (item.type === 'Submenu' || item.type === 'Enum') && item.menu) {
            menuParts.push('menu');
        }
    }
    
    return menuParts.join('.');
};

const resolveLinkedDefault = (item, menuDict) => {
    if (!item.linked_default) return item.value;

    const menuPath = convertOutputPathToMenuPath(item.linked_default, menuDict);
    const linkedItem = getDescendantProp(menuDict, menuPath);
    
    if (linkedItem && linkedItem.hasOwnProperty('value')) {
        return linkedItem.value;
    }
    
    return item.value; // Fallback to original value if linked item not found
};

const propagateEnumMenuChanges = (changedEnumPath, menuDict) => {
        
    const findLinkedEnums = (obj, currentPath = '') => {
        const linkedEnums = [];
                
        // Convert changedEnumPath to reduced path for comparison
        const reducedChangedPath = changedEnumPath.replace(/\.menu/g, '');
        
        for (const [key, item] of Object.entries(obj)) {
            const itemPath = currentPath ? `${currentPath}.${key}` : key;
            
            if (item.type === 'Enum' && item.linked_default && item.linked_default === reducedChangedPath) {
                linkedEnums.push(itemPath);
            }
            
            // Recursively search in submenus
            if ((item.type === 'Submenu' || item.type === 'Enum') && item.menu) {
                linkedEnums.push(...findLinkedEnums(item.menu, `${itemPath}.menu`));
            }
        }
        
                return linkedEnums;
    };
    
    const linkedEnumPaths = findLinkedEnums(menuDict);
        
    const sourceEnum = getDescendantProp(menuDict, changedEnumPath);
        
    if (!sourceEnum || !sourceEnum.menu) {
        return;
    }
    
    for (const linkedPath of linkedEnumPaths) {
        const linkedEnum = getDescendantProp(menuDict, linkedPath);

        if (linkedEnum && linkedEnum.type === 'Enum') {
            const replaceMenu = linkedEnum.value === '';

            // Only overwrite if the linked enum's menu is empty
            if (replaceMenu) {
                linkedEnum.menu = JSON.parse(JSON.stringify(sourceEnum.menu));

                // Reset value if it's no longer valid in the new menu
                const currentValue = linkedEnum.value;
                const encodedValue = currentValue ? currentValue.replace(/\./g, '__dot__') : null;
                const isValidValue = encodedValue && linkedEnum.menu[encodedValue];

                if (currentValue && !isValidValue) {
                    const firstOption = Object.keys(linkedEnum.menu)[0];

                    if (firstOption) {
                        linkedEnum.value = firstOption.replace(/__dot__/g, '.');
                    } else {
                        linkedEnum.value = "";
                    }
                }
            }
        }
    }
};

const flattenOptionValues = (menu, menuDict) => {
    let options = {};
    for (const key in menu) {
        const item = menu[key];
        if (item.type === 'Submenu' && item.menu) {
            options[key] = flattenOptionValues(item.menu, menuDict);
        } else if (item.hasOwnProperty('value')) {
            // Use linked default if value is blank/empty
            if ((!item.value || item.value === '') && item.linked_default) {
                options[key] = resolveLinkedDefault(item, menuDict);
            } else {
                options[key] = item.value;
            }
        }
    }
    return options;
};

const generateLinkedPath = (outputPath, menuDict) => {
    if (!outputPath) return '';
    
    const parts = outputPath.split('.');
    const pathNames = [];

    // Build path incrementally to get all parent names
    for (let i = 0; i < parts.length; i++) {
        const partialOutputPath = parts.slice(0, i + 1).join('.');
        
        // For partial paths, we need to handle the conversion differently
        let partialMenuPath;
        if (i === parts.length - 1) {
            // For the final item, use the full conversion
            partialMenuPath = convertOutputPathToMenuPath(partialOutputPath, menuDict);
        } else {
            // For parent items, build the menu path manually
            const pathParts = parts.slice(0, i + 1);
            const menuParts = [];
            
            for (let j = 0; j < pathParts.length; j++) {
                menuParts.push(pathParts[j]);
                
                // Check if this part is a Submenu/Enum and we're not at the last part
                if (j < pathParts.length - 1) {
                    const currentPath = menuParts.join('.');
                    const item = getDescendantProp(menuDict, currentPath);
                    if (item && (item.type === 'Submenu' || item.type === 'Enum') && item.menu) {
                        menuParts.push('menu');
                    }
                }
            }
            partialMenuPath = menuParts.join('.');
        }
        
        const item = getDescendantProp(menuDict, partialMenuPath);
        
        if (item && item.name) {
            pathNames.push(item.name);
        }
    }
    
    return pathNames.join('  ');
};

const generateVCard = (key, item, pathPrefix, menuDict) => {
    let subtitle = item.description;
    // Add linked default note if present
    let linkedItem = null;
    if (item.linked_default) {
        const linkedPath = generateLinkedPath(item.linked_default, menuDict);
        // Convert linked_default to menu path before lookup, with final ".menu" removed from path
        const linkedMenuPath = convertOutputPathToMenuPath(item.linked_default, menuDict).replace(/\.menu$/, '');
        linkedItem = getDescendantProp(menuDict, linkedMenuPath);
        if (linkedPath) {
            subtitle += ` (if blank, defaults to ${linkedPath})`;
        }
    }

    const fullPath = pathPrefix ? `${pathPrefix}.${key}` : key;
    let title = item.name;

    if (item.masked && item.hasOwnProperty('value')) {
        title += ': ********';
    } else if (item.hasOwnProperty('value') && item.type !== 'Submenu' && item.type !== 'Boolean') {
        let displayValue = String(item.value);
        if (displayValue.length > 35) {
            displayValue = displayValue.slice(0, 35) + '...';
        }
        if (item.type === 'Enum') {
            if (item.value === '' && linkedItem && linkedItem.menu && linkedItem.menu[linkedItem.value]) {
                displayValue = ` ( ${linkedItem.menu[linkedItem.value].name} )`;
            } else if (item.menu && item.menu[item.value]) {
                displayValue = item.menu[item.value].name;
            }
        }
        if (item.unit) {
            displayValue += ` ${item.unit}`;
        }
        if ((!displayValue || displayValue === '') && linkedItem && linkedItem.hasOwnProperty('value')) {
            title += ` (${linkedItem.value})`;
        } else {
            title += ': ' + displayValue;
        }
    }

    const vCardParts = [
        'BEGIN:VCARD', 'VERSION:3.0', `N;CHARSET=UTF-8:${title};`, `ORG;CHARSET=UTF-8:${subtitle};`, `NOTE;CHARSET=UTF-8:${fullPath}`, `TITLE;CHARSET=UTF-8:${item.type}`
    ];

    if (iconDict[item.icon] || iconDict[item.type]) {
        let icon = iconDict[item.icon] ? iconDict[item.icon] : iconDict[item.type];
        if (icon) {
            if (item.type === 'Boolean') {
                if (iconDict[item.icon]) {
                    const checkmark = item.value ? '' : '';
                    vCardParts[2] = `N;CHARSET=UTF-8:${checkmark} ${title};`;
                } else {
                    icon = icon[String(item.value)];
                }
            } else if (item.type === 'EnumOption') {
                // If the parent Enum item's value is `key`, then set icon to `icon['true']` otherwise `icon['false']`
                const parentEnumItem = getDescendantProp(menuDict, pathPrefix.replace(/\.menu$/, ''));
                const bool_value = parentEnumItem.value === key;
                if (iconDict[item.icon]) {
                    const radiomark = bool_value ? '' : '';
                    vCardParts[2] = `N;CHARSET=UTF-8:${radiomark} ${title};`;
                } else {
                    icon = icon[bool_value ? 'true' : 'false'];
                }
            }
            const b64Icon = icon[DARK_MODE_STR];
            if (b64Icon && b64Icon !== "...") {
                vCardParts.push(`PHOTO;ENCODING=b:${b64Icon}`);
            }
        }
    }
    if (item.type === 'Number') {
        let descSuffix = `. Current: ${item.value}`;
        if (item.unit) descSuffix += ` ${item.unit}`;
        const rangeParts = [];
        if (item.hasOwnProperty('min')) rangeParts.push(`Min: ${item.min}`);
        if (item.hasOwnProperty('max')) rangeParts.push(`Max: ${item.max}`);
        if (rangeParts.length > 0) descSuffix += ` (${rangeParts.join(', ')})`;
        vCardParts.push(`NICKNAME;CHARSET=UTF-8:${descSuffix}`);
    }

    vCardParts.push('END:VCARD');
    return vCardParts.join('\n');
};

// ========================================================================
// :: CORE LOGIC
// ========================================================================
const processMenu = (menu, state) => {
    const menuDict = JSON.parse(JSON.stringify(menu));

    let newPath = state.current_path;
    let command = null;
    let error = null;
    
    // 1. --- APPLY NEW VALUE OR NAVIGATION ---
    let optionsChanged = false;
    if (state.new_value) {
        for (const itemPath of Object.keys(state.new_value)) {
            const itemName = itemPath.split('.').pop();
            const itemToUpdate = getDescendantProp(menuDict, itemPath);

            if (itemName === "__back__") {
                const pathParts = newPath.split('.');
                newPath = pathParts.slice(0, -2).join('.');
            } else if (itemPath.endsWith('.menu')) {
                // Handle updating Enum options
                const enumPath = itemPath.replace(/\.menu$/, '');
                const enumItem = getDescendantProp(menuDict, enumPath);
                
                if (!enumItem) {
                    error = `Error: Could not find enum item at path '${enumPath}' to update options.`;
                } else if (enumItem.type !== 'Enum') {
                    error = `Error: Item at path '${enumPath}' is not an Enum type.`;
                } else {
                    const newOptions = state.new_value[itemPath];
                    if (Array.isArray(newOptions)) {
                        enumItem.menu = {};
                        newOptions.forEach(option => {
                            const nameEscapedDots = option.replace(/\./g, '__dot__');
                            enumItem.menu[nameEscapedDots] = {
                                type: 'EnumOption',
                                name: option,
                                description: ""
                            };
                        });
                        // If current value is no longer valid, reset to first option or empty
                        if (!enumItem.menu[enumItem.value.replace(/\./g, '__dot__')]) {
                            enumItem.value = newOptions[0] || "";
                        }
                        
                        // Propagate menu changes to linked enums
                        propagateEnumMenuChanges(enumPath, menuDict);
                        
                        optionsChanged = true;
                    } else {
                        error = `Error: Options value must be an array for enum at path '${enumPath}'.`;
                    }
                }
            } else if (itemToUpdate && itemToUpdate.type === 'EnumOption') {
                const selectedOptionKey = itemName;
                const enumItemPath = state.current_path.replace(/\.menu$/, '');
                const enumItem = getDescendantProp(menuDict, enumItemPath);
                
                if (enumItem && enumItem.menu.hasOwnProperty(selectedOptionKey)) {
                    const itemNameCommasToDots = selectedOptionKey.replace(/__dot__/g, '.');
                    enumItem.value = itemNameCommasToDots;
                    const pathParts = enumItemPath.split('.');
                    newPath = pathParts.slice(0, -2).join('.');
                    optionsChanged = true;
                } else {
                    error = `Invalid option '${selectedOptionKey}' selected.`;
                }
            } else {
                const newValue = state.new_value[itemPath];
                if (!itemToUpdate) {
                    error = `Error: Could not find item at path '${itemPath}' to update.`;
                } else {
                    switch (itemToUpdate.type) {
                        case 'Command': 
                            command = itemPath;
                            break;
                        case 'Boolean': 
                            itemToUpdate.value = !itemToUpdate.value; 
                            optionsChanged = true; 
                            break;
                        case 'Date': 
                            itemToUpdate.value = String(newValue); 
                            optionsChanged = true; 
                            break;
                        case 'Datetime': 
                            itemToUpdate.value = String(newValue); 
                            optionsChanged = true; 
                            break;
                        case 'Enum':
                        case 'Number':
                            let num = Number(newValue);
                            if (itemToUpdate.hasOwnProperty('max')) num = Math.min(itemToUpdate.max, num);
                            if (itemToUpdate.hasOwnProperty('min')) num = Math.max(itemToUpdate.min, num);
                            if (itemToUpdate.allow_decimal === false) num = Math.round(num);
                            itemToUpdate.value = num; 
                            optionsChanged = true;
                            break;
                        case 'String': 
                            itemToUpdate.value = String(newValue); 
                            optionsChanged = true; 
                            break;
                        case 'Submenu':
                            newPath = itemPath + ".menu"; 
                            break;
                        case 'Time': 
                            itemToUpdate.value = String(newValue); 
                            optionsChanged = true; 
                            break;
                        case 'URL': 
                            itemToUpdate.value = String(newValue); 
                            optionsChanged = true; 
                            break;
                        default: error = `Error: Unsupported item type '${itemToUpdate.type}' for item at path '${itemPath}'.`;
                    }
                }
            }
        }
    }

    // 2. --- LOAD INITIAL VALUES ---
    // Done after applying new values so that any initial values that depend on new values 
    // (e.g. an enum that's had its menu changed) stay relevant.
    if (state.option_values) {
        const applyOptionValues = (options, menu, path = []) => {
            for (const key in options) {
                if (typeof options[key] === 'object' && options[key] !== null && !Array.isArray(options[key])) {
                    // Recurse into nested object
                    if (menu[key] && (menu[key].type === 'Submenu' || menu[key].type === 'Enum') && menu[key].menu) {
                        applyOptionValues(options[key], menu[key].menu, path.concat(key, 'menu'));
                    } else if (menu[key]) {
                        applyOptionValues(options[key], menu[key], path.concat(key));
                    }
                } else {
                    // Leaf node, update value
                    if (menu[key] && menu[key].hasOwnProperty('value')) {
                        menu[key].value = options[key];
                    }
                }
            }
        };
        applyOptionValues(state.option_values, menuDict);
    }

    // 3. --- GENERATE VCARD MENU FOR CURRENT LEVEL ---
    let currentMenuLevel = getDescendantProp(menuDict, newPath);
    if (!currentMenuLevel) throw new Error(`Could not navigate to menu path: '${newPath}'`);

    if (currentMenuLevel.type === 'Submenu' || currentMenuLevel.type === 'Enum') {
        newPath += '.menu';
        currentMenuLevel = currentMenuLevel.menu;
    }

    const vCardMenu = [];

    if (newPath) {
        const parentItemPath = newPath.substring(0, newPath.lastIndexOf('.menu'));
        const grandParentPath = parentItemPath.substring(0, parentItemPath.lastIndexOf('.'));

        let backButtonName = "Main menu";
        let backButtonIconObject = iconDict['Submenu'] ? iconDict['Submenu'][DARK_MODE_STR] : null;

        // If the grandParentPath is not the root, it must point to a menu object.
        // The item that OWNS that menu object is what we need for the name and icon.
        if (grandParentPath) {
            const ownerOfGrandParentMenuPath = grandParentPath.substring(0, grandParentPath.lastIndexOf('.menu'));
            const ownerItem = getDescendantProp(menuDict, ownerOfGrandParentMenuPath);
            if (ownerItem && ownerItem.name) {
                backButtonName = ownerItem.name;
                if (iconDict[ownerItem.icon]) {
                    backButtonIconObject = iconDict[ownerItem.icon][DARK_MODE_STR];
                }
            }
        }
        
        const backVCardParts = ['BEGIN:VCARD', 'VERSION:3.0', `N;CHARSET=UTF-8:Back to ${backButtonName}`, 'ORG:Go to previous menu'];
        if (backButtonIconObject && backButtonIconObject !== "...") { backVCardParts.push(`PHOTO;ENCODING=b:${backButtonIconObject}`); }
        backVCardParts.push('NOTE:__back__', 'END:VCARD');
        vCardMenu.push(backVCardParts.join('\n'));

    }

    // Add a "Save and quit" button next, with its icon
    const saveAndQuitVCardParts = ['BEGIN:VCARD', 'VERSION:3.0', `N;CHARSET=UTF-8:Exit settings`, 'ORG:Everything is saved'];
    if (iconDict['quit_button']) { saveAndQuitVCardParts.push(`PHOTO;ENCODING=b:${iconDict['quit_button'][DARK_MODE_STR]}`); }
    saveAndQuitVCardParts.push('NOTE:__quit__', 'END:VCARD');
    vCardMenu.push(saveAndQuitVCardParts.join('\n'));

    // Sort menu items by index, then alphabetically by name
    const sortedEntries = Object.entries(currentMenuLevel).sort(([, a], [, b]) => {
        const aHasIndex = a.hasOwnProperty('index');
        const bHasIndex = b.hasOwnProperty('index');

        if (aHasIndex && bHasIndex) return a.index - b.index;
        if (aHasIndex) return -1;
        if (bHasIndex) return 1;
        return a.name.localeCompare(b.name);
    });

    for (const [key, item] of sortedEntries) {
        vCardMenu.push(generateVCard(key, item, newPath, menuDict));
    }

    // 4. --- PREPARE RETURN OBJECT ---
    const optionValues = flattenOptionValues(menuDict, menuDict);
    const finalState = { current_path: newPath, parent_name: "Main menu" };

    if (newPath) {
        const parentPath = newPath.substring(0, newPath.lastIndexOf('.'));
        const parentMenuItem = getDescendantProp(menuDict, parentPath);
        finalState.parent_name = parentMenuItem && parentMenuItem.name ? parentMenuItem.name : "Main menu";
    }
    
    const returnObject = {
        menu: vCardMenu,
        option_values: optionValues,
        menu_dict: menuDict,
        state: finalState,
        options_changed: optionsChanged,
    };
    
    if (command) returnObject.command = command;
    if (error) returnObject.error = error;
    
    return returnObject;
};

// ========================================================================
// :: SCRIPT EXECUTION
// ========================================================================
let result;
try {
    result = processMenu(menuDictIn, stateDict);
} catch (e) {
    result = { error: `JavaScript execution failed: ${e.message}` };
}

result = processMenu(menuDictIn, stateDict);

